async function skinUpdate(_id: string, classe: string, picture: string, color: Array<string>, object: Array<string>, favorite: number, creator: string, token:string | undefined) {
    var data: any = []
    const response = await fetch("http://localhost:4000/skins" + _id, {
        method: "PUT",
        body: JSON.stringify({ _id, classe, picture, color, object, favorite, creator}),
        headers: { authorization : "Bearer " + token}
    });
    data = [await response.status];
    return data
}

export default skinUpdate;
